import React from "react";
import Navbar from "./Navbar/Navbar";
import { BrowserRouter, Routes, Route } from "react-router-dom";

const App = () => {
  return (
    <div>
        <BrowserRouter>
        <Navbar />
        <Routes>
            <Route path="/"></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
